import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';

const AchievementPreview = () => {
  const [earnedAchievements, setEarnedAchievements] = useState([]);
  const [availableAchievements, setAvailableAchievements] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAchievements();

    // Listen for progress updates
    const handleProgressUpdate = () => {
      fetchAchievements();
    };

    window.addEventListener('progressUpdated', handleProgressUpdate);

    return () => {
      window.removeEventListener('progressUpdated', handleProgressUpdate);
    };
  }, []);

  const fetchAchievements = async () => {
    try {
      const sessionId = localStorage.getItem('sessionId');
      if (!sessionId) return;

      const response = await axios.get('http://localhost:5001/api/recommendations/achievements', {
        headers: { 'x-session-id': sessionId }
      });

      if (response.data.success) {
        const data = response.data.data || {};
        setEarnedAchievements(data.earned || []);
        setAvailableAchievements(data.available || []);
      }
    } catch (error) {
      console.error('Error fetching achievements:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="space-y-3">
        <div className="flex items-center space-x-3 p-3 bg-gray-50 dark:bg-gray-700 rounded-lg animate-pulse">
          <div className="w-8 h-8 bg-gray-300 dark:bg-gray-600 rounded"></div>
          <div className="flex-1">
            <div className="h-4 bg-gray-300 dark:bg-gray-600 rounded w-3/4 mb-1"></div>
            <div className="h-3 bg-gray-300 dark:bg-gray-600 rounded w-1/2"></div>
          </div>
        </div>
      </div>
    );
  }

  // Filter for recent achievements (unlocked ones)
  const unlockedAchievements = achievements.filter(a => a.unlocked);
  const lockedAchievements = achievements.filter(a => !a.unlocked);

  return (
    <div className="space-y-3">
      {/* Show latest unlocked achievement */}
      {unlockedAchievements.length > 0 && (
        <div className="flex items-center space-x-3 p-3 bg-gradient-to-r from-green-50 to-emerald-50 dark:from-green-900/20 dark:to-emerald-900/20 rounded-lg border border-green-200 dark:border-green-700 animate-scale-in">
          <span className="text-2xl">{unlockedAchievements[0].icon || '🏆'}</span>
          <div>
            <h4 className="font-medium text-green-800 dark:text-green-200">
              {unlockedAchievements[0].title}
            </h4>
            <p className="text-xs text-green-600 dark:text-green-400">
              {unlockedAchievements[0].description}
            </p>
          </div>
        </div>
      )}

      {/* Show next achievement to unlock */}
      {lockedAchievements.length > 0 && (
        <div className="flex items-center space-x-3 p-3 bg-gray-50 dark:bg-gray-700/50 rounded-lg border border-gray-200 dark:border-gray-600 opacity-60 animate-scale-in animation-delay-100">
          <span className="text-2xl">{lockedAchievements[0].icon || '🎯'}</span>
          <div>
            <h4 className="font-medium text-gray-600 dark:text-gray-400">
              {lockedAchievements[0].title}
            </h4>
            <p className="text-xs text-gray-500 dark:text-gray-500">
              {lockedAchievements[0].progress_description || lockedAchievements[0].description}
            </p>
          </div>
        </div>
      )}

      {/* Fallback if no achievements */}
      {achievements.length === 0 && (
        <div className="space-y-3">
          <div className="flex items-center space-x-3 p-3 bg-gradient-to-r from-blue-50 to-indigo-50 dark:from-blue-900/20 dark:to-indigo-900/20 rounded-lg border border-blue-200 dark:border-blue-700">
            <span className="text-2xl">🚀</span>
            <div>
              <h4 className="font-medium text-blue-800 dark:text-blue-200">Start Your Journey</h4>
              <p className="text-xs text-blue-600 dark:text-blue-400">Solve your first problem to earn achievements!</p>
            </div>
          </div>
        </div>
      )}

      <div className="text-center pt-2">
        <Link 
          to="/progress"
          className="text-sm text-blue-600 dark:text-blue-400 hover:text-blue-700 dark:hover:text-blue-300 font-medium hover-glow"
        >
          View all achievements →
        </Link>
      </div>
    </div>
  );
};

export default AchievementPreview;
